            "什么是NFT": "Was ist NFT?",
            "NFT（不可替代代币）是存储在区块链上的独特数字项目。NFT几乎可以代表任何东西，并作为数字记录所有权。": "NFTs (nicht fungible Token) sind einzigartige digitale Gegenstände, die auf der Blockchain gespeichert sind. NFTs können fast alles darstellen und als digitale Eigentumsaufzeichnung dienen.",
            "跨市场流动性聚合：": "Marktübergreifende Liquiditätsaggregation:",
            "实时获取OpenSea,LooksRare,MagicEden,IMXOfficial等主流平台的NFT订单，并支持多平台一键下单，为您聚合全网交易流动性。": "Erhalten Sie NFT-Bestellungen in Echtzeit von Mainstream-Plattformen wie OpenSea, LooksRare, MagicEden, IMXOfficial usw. und unterstützen Sie die Auftragserteilung mit einem Klick auf mehreren Plattformen, um die Transaktionsliquidität im gesamten Netzwerk für Sie zu bündeln.",
            "发行市场定期推出优质项目，二级市场支持稀有度查询和批量购买，数据统计部分提供链上实时数据辅助决策，帮助您全面掌控行业交易机会，快速交易。": "Der {name}-Emissionsmarkt bringt regelmäßig hochwertige Projekte auf den Markt. Der Sekundärmarkt unterstützt Raritätenanfragen und Großeinkäufe. Der Abschnitt mit den Datenstatistiken bietet Echtzeitdaten zur Kette, um die Entscheidungsfindung zu unterstützen und Ihnen dabei zu helfen, die Handelsmöglichkeiten der Branche vollständig zu kontrollieren schnell handeln.",
