            "本协议对双方具有法律约束力，可在联合国境内签署和执行 国家和欧洲。双方声明有权签署本协议": "Ця Угода є юридично обов’язковою для сторін і може бути підписана та виконана в рамках Організації Об’єднаних Націй та Європи. Обидві сторони заявляють, що вони мають повноваження укласти цю Угоду",
