            "法律效力": "法律效力",
            "本协议对双方具有法律约束力，可在联合国境内签署和执行 国家和欧洲。双方声明有权签署本协议": "本協議對雙方具有法律約束力，可在聯合國境內簽署和執行 國家和歐洲。雙方聲明有權簽署本協議",
            "各种各样的": "各種各樣的",
