            "本协议应根据所在国家的法律解释和执行 借款人所在地": "本協議應根據所在國家的法律解釋和執行 借款人所在地",
            "本协议资金由第三方银行贷款机构提供，所有提供的资金必须由本人尝还": "本協議資金由第三方銀行貸款機構提供，所有提供的資金必須由本人嚐還",
